    def item13=[itemord:10,itemid:355,content:"Le agrademos que acepte participar en este estudio. Durante la entrevista, le preguntaré sobre los trabajos que ha realizado, su historial médico y otras preguntas sobre su pasado. Su participación en este estudio es voluntaria y en cualquier momento puede no contestar una pregunta si así lo desea. Su cooperación es muy importante para este estudio de investigación, ya que nos ayudará a conocer más sobre la salud en personas adultas. Introduciré sus respuestas en el ordenador. Me gustaría recordarle que la información que usted nos proporcione será absolutamente confidencial. Si usted no entiende alguna cosa pregunte, por favor. Estas preguntas tienen una duración de 60 minutos aproximadamente, pero podemos hacer una pausa si usted se cansa. Empezamos, ¿le parece?",idq:null,codq:null, itrep:null, highlight:0,itparent:null,secid:401,secname:"Introducción",answer_number:1,answer_order:null,idpat:20,codpatient:"15700000000",thevalue:"9999",typename:null,idansitem:null,pattern:"null"]
